(43, 'App\\Models\\User', 1, 'updated', 'App\\Models\\Page', 1, '{\"contents\":\"<div class=\\\"offers-section\\\" style=\\\"background-color: #f9f9f9; padding: 40px; border-radius: 10px; box-shadow: 0 4px 10px rgba(0, 0, 0, 0.1);\\\">\\n<h2 class=\\\"offers-title\\\" style=\\\"text-align: center; font-family: Arial, sans-serif; color: #333; margin-bottom: 20px;\\\">What We Offer<\\/h2>\\n<p class=\\\"offers-description\\\" style=\\\"text-align: center; font-family: Arial, sans-serif; color: #666; margin-bottom: 40px; max-width: 600px; margin-left: auto; margin-right: auto;\\\">We provide end-to-end solutions designed to help businesses build reliable, scalable, and user-focused digital products.<\\/p>\\n<div class=\\\"offers-grid\\\" style=\\\"display: grid; grid-template-columns: repeat(auto-fill, minmax(250px, 1fr)); gap: 20px;\\\">\\n<div class=\\\"offer-card\\\" style=\\\"background-color: #fff; border-radius: 8px; padding: 20px; box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1); transition: transform 0.3s;\\\">\\n<h3 style=\\\"color: #007bff;\\\">\\ud83d\\ude80 High Performance Systems<\\/h3>\\n<p style=\\\"color: #555;\\\">Optimized applications built for speed, scalability, and long-term reliability under real-world workloads.<\\/p>\\n<\\/div>\\n<div class=\\\"offer-card\\\" style=\\\"background-color: #fff; border-radius: 8px; padding: 20px; box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1); transition: transform 0.3s;\\\">\\n<h3 style=\\\"color: #007bff;\\\">\\ud83d\\udd12 Secure Architecture<\\/h3>\\n<p style=\\\"color: #555;\\\">Security-first development using best practices to protect data, users, and business operations.<\\/p>\\n<\\/div>\\n<div class=\\\"offer-card\\\" style=\\\"background-color: #fff; border-radius: 8px; padding: 20px; box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1); transition: transform 0.3s;\\\">\\n<h3 style=\\\"color: #007bff;\\\">\\ud83c\\udfa8 Modern UI &amp; UX<\\/h3>\\n<p style=\\\"color: #555;\\\">Clean, intuitive interfaces designed to improve usability, engagement, and user satisfaction.<\\/p>\\n<\\/div>\\n<div class=\\\"offer-card\\\" style=\\\"background-color: #fff; border-radius: 8px; padding: 20px; box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1); transition: transform 0.3s;\\\">\\n<h3 style=\\\"color: #007bff;\\\">\\u2699\\ufe0f Custom Development<\\/h3>\\n<p style=\\\"color: #555;\\\">Tailored solutions built around your business needs, workflows, and long-term goals.<\\/p>\\n<\\/div>\\n<div class=\\\"offer-card\\\" style=\\\"background-color: #fff; border-radius: 8px; padding: 20px; box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1); transition: transform 0.3s;\\\">\\n<h3 style=\\\"color: #007bff;\\\">\\u2601\\ufe0f Cloud &amp; Deployment<\\/h3>\\n<p style=\\\"color: #555;\\\">Scalable cloud infrastructure, CI\\/CD pipelines, and deployment strategies that just work.<\\/p>\\n<\\/div>\\n<div class=\\\"offer-card\\\" style=\\\"background-color: #fff; border-radius: 8px; padding: 20px; box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1); transition: transform 0.3s;\\\">\\n<h3 style=\\\"color: #007bff;\\\">\\ud83d\\udee0 Ongoing Support<\\/h3>\\n<p style=\\\"color: #555;\\\">Continuous maintenance, monitoring, and improvements to keep your system healthy.<\\/p>\\n<\\/div>\\n<\\/div>\\n<\\/div>\\n<div class=\\\"cms-carousel\\\" style=\\\"margin-top: 40px; overflow: hidden;\\\">\\n<div class=\\\"cms-slide\\\" style=\\\"display: flex; justify-content: center; align-items: center;\\\">\\n<div class=\\\"offer-card\\\" style=\\\"background-color: #fff; border-radius: 8px; padding: 20px; box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);\\\">\\n<h3 style=\\\"color: #007bff;\\\">\\ud83d\\ude80 High Performance Systems<\\/h3>\\n<p style=\\\"color: #555;\\\">Optimized applications built for speed.<\\/p>\\n<\\/div>\\n<\\/div>\\n<div class=\\\"cms-slide\\\" style=\\\"display: flex; justify-content: center; align-items: center;\\\">\\n<div class=\\\"offer-card\\\" style=\\\"background-color: #fff; border-radius: 8px; padding: 20px; box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);\\\">\\n<h3 style=\\\"color: #007bff;\\\">\\ud83d\\udd12 Secure Architecture<\\/h3>\\n<p style=\\\"color: #555;\\\">Security-first development.<\\/p>\\n<\\/div>\\n<\\/div>\\n<div class=\\\"cms-slide\\\" style=\\\"display: flex; justify-content: center; align-items: center;\\\">\\n<div class=\\\"offer-card\\\" style=\\\"background-color: #fff; border-radius: 8px; padding: 20px; box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);\\\">\\n<h3 style=\\\"color: #007bff;\\\">\\ud83c\\udfa8 Modern UI &amp; UX<\\/h3>\\n<p style=\\\"color: #555;\\\">Clean and intuitive interfaces.<\\/p>\\n<\\/div>\\n<\\/div>\\n<\\/div>\"}', '{\"contents\":\"<section class=\\\"section section-soft\\\">\\n<div class=\\\"container-md\\\"><!-- Header -->\\n<div class=\\\"section-header\\\">\\n<h2 class=\\\"section-title\\\">What We Offer<\\/h2>\\n<p class=\\\"section-desc\\\">We provide end-to-end solutions designed to help businesses build reliable, scalable, and user-focused digital products.<\\/p>\\n<\\/div>\\n<!-- Cards -->\\n<div class=\\\"grid grid-cards\\\">\\n<div class=\\\"card\\\">\\n<h3>\\ud83d\\ude80 High Performance Systems<\\/h3>\\n<p>Optimized applications built for speed, scalability, and long-term reliability under real-world workloads.<\\/p>\\n<\\/div>\\n<div class=\\\"card\\\">\\n<h3>\\ud83d\\udd12 Secure Architecture<\\/h3>\\n<p>Security-first development using proven best practices to protect data, users, and business operations.<\\/p>\\n<\\/div>\\n<div class=\\\"card\\\">\\n<h3>\\ud83c\\udfa8 Modern UI &amp; UX<\\/h3>\\n<p>Clean, intuitive interfaces designed to improve usability, engagement, and overall user satisfaction.<\\/p>\\n<\\/div>\\n<div class=\\\"card\\\">\\n<h3>\\u2699\\ufe0f Custom Development<\\/h3>\\n<p>Tailored solutions built around your business needs, workflows, and long-term goals.<\\/p>\\n<\\/div>\\n<div class=\\\"card\\\">\\n<h3>\\u2601\\ufe0f Cloud &amp; Deployment<\\/h3>\\n<p>Scalable cloud infrastructure, CI\\/CD pipelines, and deployment strategies that just work.<\\/p>\\n<\\/div>\\n<div class=\\\"card\\\">\\n<h3>\\ud83d\\udee0 Ongoing Support<\\/h3>\\n<p>Continuous maintenance, monitoring, and improvements to keep your system secure, fast, and healthy.<\\/p>\\n<\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/section>\\n<section class=\\\"section\\\">\\n<div class=\\\"container-md\\\">\\n<div class=\\\"section-header\\\">\\n<h2 class=\\\"section-title\\\">How We Work<\\/h2>\\n<p class=\\\"section-desc\\\">A clear, collaborative process that keeps projects aligned, efficient, and focused on real outcomes.<\\/p>\\n<\\/div>\\n<div class=\\\"grid grid-steps\\\">\\n<div class=\\\"step-card\\\"><span class=\\\"step-number\\\">01<\\/span>\\n<h3>Discovery &amp; Planning<\\/h3>\\n<p>We start by understanding your goals, challenges, and users to define a clear roadmap for success.<\\/p>\\n<\\/div>\\n<div class=\\\"step-card\\\"><span class=\\\"step-number\\\">02<\\/span>\\n<h3>Design &amp; Development<\\/h3>\\n<p>Our team designs intuitive interfaces and builds scalable systems using modern, proven technologies.<\\/p>\\n<\\/div>\\n<div class=\\\"step-card\\\"><span class=\\\"step-number\\\">03<\\/span>\\n<h3>Launch &amp; Improve<\\/h3>\\n<p>We deploy with confidence, monitor performance, and continuously improve based on real-world feedback.<\\/p>\\n<\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/section>\\n<section class=\\\"section section-soft\\\">\\n<div class=\\\"container-md\\\">\\n<div class=\\\"split\\\">\\n<div class=\\\"split-text\\\">\\n<h2 class=\\\"section-title\\\">Why Choose Us<\\/h2>\\n<p class=\\\"section-desc align-left\\\">We&rsquo;re not just building software &mdash; we&rsquo;re building long-term partnerships focused on quality, clarity, and sustainable growth.<\\/p>\\n<\\/div>\\n<div class=\\\"split-list\\\">\\n<div class=\\\"list-item\\\">\\n<h4>Experienced Team<\\/h4>\\n<p>Years of hands-on experience delivering real-world systems across different industries.<\\/p>\\n<\\/div>\\n<div class=\\\"list-item\\\">\\n<h4>Clear Communication<\\/h4>\\n<p>Transparent timelines, regular updates, and no technical surprises.<\\/p>\\n<\\/div>\\n<div class=\\\"list-item\\\">\\n<h4>Future-Ready Solutions<\\/h4>\\n<p>Built with scalability and maintainability in mind, so your product grows with your business.<\\/p>\\n<\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/section>\"}', 'https://cms4.webfocusprod.wsiph2.com/cms5-api/public/api/pages/1', '180.194.24.239', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/143.0.0.0 Safari/537.36', NULL, '2026-01-20 23:43:27', '2026-01-20 23:43:27'),
