(92, 'App\\Models\\User', 1, 'updated', 'App\\Models\\Page', 2, '{\"contents\":\"<h1 style=\\\"color: #0056b3; border-bottom: 2px solid rgb(0, 86, 179); padding-bottom: 5px; font-family: Arial, sans-serif; text-align: center;\\\"><img style=\\\"display: block; margin-left: auto; margin-right: auto;\\\" src=\\\"https:\\/\\/encrypted-tbn0.gstatic.com\\/images?q=tbn:ANd9GcQdbk6PtQqqKgVprlkd1tzekP3ufz1tCW8q_w&amp;s\\\" alt=\\\"\\\" width=\\\"54\\\" height=\\\"54\\\"> About WebFocus Solutions, Inc.<\\/h1>\\n<p style=\\\"font-family: Arial, sans-serif; font-size: 16px; line-height: 1.6; color: #333;\\\"><strong>WebFocus Solutions, Inc.<\\/strong> is a Philippines-based IT company founded in <strong>2001<\\/strong>, headquartered in Pasig City, at the Antel Global Corporate Center, Ortigas Center.<\\/p>\\n<h2 style=\\\"color: #007bff; font-family: Arial, sans-serif; margin-top: 20px;\\\">Services &amp; Capabilities<\\/h2>\\n<ul style=\\\"font-family: Arial, sans-serif; font-size: 16px; line-height: 1.6; padding-left: 20px;\\\">\\n<li><strong>Web Design &amp; Development:<\\/strong> Custom websites and web applications tailored to client needs.<\\/li>\\n<li><strong>Web Hosting &amp; Domains:<\\/strong> Domain registration, cloud hosting, dedicated servers, and managed hosting.<\\/li>\\n<li><strong>Managed IT Services:<\\/strong> Ongoing IT support and infrastructure management.<\\/li>\\n<li><strong>E-Commerce Solutions:<\\/strong> Custom online stores and e-commerce platforms.<\\/li>\\n<li><strong>Document Management Systems:<\\/strong> Secure storage and management of enterprise documents.<\\/li>\\n<\\/ul>\\n<h2 style=\\\"color: #007bff; font-family: Arial, sans-serif; margin-top: 20px;\\\">Approach &amp; Values<\\/h2>\\n<ul style=\\\"font-family: Arial, sans-serif; font-size: 16px; line-height: 1.6; padding-left: 20px;\\\">\\n<li>Focus on <strong>custom solutions<\\/strong> rather than one-size-fits-all templates.<\\/li>\\n<li>Emphasis on <strong>security and reliability<\\/strong> for client websites and applications.<\\/li>\\n<li>Prioritizes <strong>customer support<\\/strong> with 24\\/7 assistance for hosting and managed services.<\\/li>\\n<li>Committed to <strong>innovation<\\/strong> and up-to-date technology stacks.<\\/li>\\n<li>Seeks <strong>return on investment (ROI)<\\/strong> for clients through effective web solutions.<\\/li>\\n<\\/ul>\\n<h2 style=\\\"color: #007bff; font-family: Arial, sans-serif; margin-top: 20px;\\\">Reputation &amp; Strengths<\\/h2>\\n<ul style=\\\"font-family: Arial, sans-serif; font-size: 16px; line-height: 1.6; padding-left: 20px;\\\">\\n<li>Over two decades of experience in IT services.<\\/li>\\n<li>Serving over 1,600 clients, from SMEs to large enterprises.<\\/li>\\n<li>Offers an all-in-one service: hosting, domains, web development, and e-commerce solutions.<\\/li>\\n<li>Customizable solutions tailored to client requirements.<\\/li>\\n<li>Local support with knowledge of Philippine business environment.<\\/li>\\n<\\/ul>\\n<h2 style=\\\"color: #007bff; font-family: Arial, sans-serif; margin-top: 20px;\\\">Considerations<\\/h2>\\n<ul style=\\\"font-family: Arial, sans-serif; font-size: 16px; line-height: 1.6; padding-left: 20px;\\\">\\n<li>Shared hosting uptime may be slightly below industry average; no formal SLA for some plans.<\\/li>\\n<li>Some employee reviews mention limited benefits and growth opportunities.<\\/li>\\n<li>Enterprise-scale projects may require verifying infrastructure capabilities.<\\/li>\\n<\\/ul>\\n<h2 style=\\\"color: #007bff; font-family: Arial, sans-serif; margin-top: 20px;\\\">Quick Facts<\\/h2>\\n<table style=\\\"border-collapse: collapse; width: 100%; font-family: Arial, sans-serif; font-size: 16px; line-height: 1.6; margin-bottom: 15px;\\\">\\n<tbody>\\n<tr>\\n<td style=\\\"border: 1px solid #ccc; padding: 8px;\\\"><strong>Founded<\\/strong><\\/td>\\n<td style=\\\"border: 1px solid #ccc; padding: 8px;\\\">2001<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"border: 1px solid #ccc; padding: 8px;\\\"><strong>Headquarters<\\/strong><\\/td>\\n<td style=\\\"border: 1px solid #ccc; padding: 8px;\\\">Pasig City, Philippines<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"border: 1px solid #ccc; padding: 8px;\\\"><strong>Number of Clients<\\/strong><\\/td>\\n<td style=\\\"border: 1px solid #ccc; padding: 8px;\\\">1,600+<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"border: 1px solid #ccc; padding: 8px;\\\"><strong>Company Size<\\/strong><\\/td>\\n<td style=\\\"border: 1px solid #ccc; padding: 8px;\\\">51&ndash;100 employees<\\/td>\\n<\\/tr>\\n<tr>\\n<td style=\\\"border: 1px solid #ccc; padding: 8px;\\\"><strong>Website<\\/strong><\\/td>\\n<td style=\\\"border: 1px solid #ccc; padding: 8px;\\\"><a style=\\\"color: #007bff; text-decoration: none;\\\" href=\\\"https:\\/\\/www.webfocus.ph\\\" target=\\\"_blank\\\" rel=\\\"noopener\\\">webfocus.ph<\\/a><\\/td>\\n<\\/tr>\\n<\\/tbody>\\n<\\/table>\\n<p style=\\\"font-family: Arial, sans-serif; font-size: 16px; line-height: 1.6; color: #333;\\\">\\ud83c\\udfaf <strong>WebFocus Solutions<\\/strong> is a trusted partner for SMEs and organizations seeking reliable, custom web solutions, IT services, and online business support in the Philippines.<\\/p>\"}', '{\"contents\":\"<!-- Our Story -->\\n<section class=\\\"bg2-pattern p-t-116 p-b-110 t-center p-l-15 p-r-15\\\"><span class=\\\"tit2 t-center\\\"> Italian Restaurant <\\/span>\\n<h3 class=\\\"tit3 t-center m-b-35 m-t-5\\\">Our Story<\\/h3>\\n<p class=\\\"t-center size32 m-l-r-auto\\\">Fusce at risus eget mi auctor pulvinar. Suspendisse maximus venenatis pretium. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Aliquam purus purus, lacinia a scelerisque in, luctus vel felis. Donec odio diam, dignissim a efficitur at, efficitur et est. Pellentesque semper est ut pulvinar ullamcorper. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Nulla et leo accumsan, egestas velit ac, fringilla tortor. Sed varius justo sed luctus mattis.<\\/p>\\n<\\/section>\\n<!-- Video -->\\n<section class=\\\"section-video parallax100\\\" style=\\\"background-image: url(\'https:\\/\\/preview.colorlib.com\\/theme\\/pato\\/images\\/header-menu-01.jpg\');\\\">\\n<div class=\\\"content-video t-center p-t-225 p-b-250\\\"><span class=\\\"tit2 p-l-15 p-r-15\\\"> Discover <\\/span>\\n<h3 class=\\\"tit4 t-center p-l-15 p-r-15 p-t-3\\\">Our Video<\\/h3>\\n<div class=\\\"btn-play ab-center size16 hov-pointer m-l-r-auto m-t-43 m-b-33\\\" data-bs-toggle=\\\"modal\\\" data-bs-target=\\\"#modal-video-01\\\">\\n<div class=\\\"flex-c-m sizefull bo-cir bgwhite color1 hov1 trans-0-4\\\">&nbsp;<\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/section>\\n<!-- Delicious & Romantic-->\\n<section class=\\\"bg1-pattern p-t-120 p-b-105\\\">\\n<div class=\\\"container\\\"><!-- Delicious -->\\n<div class=\\\"row\\\">\\n<div class=\\\"col-md-6 p-t-45 p-b-30\\\">\\n<div class=\\\"wrap-text-delicious t-center\\\"><span class=\\\"tit2 t-center\\\"> Delicious <\\/span>\\n<h3 class=\\\"tit3 t-center m-b-35 m-t-5\\\">RECIPES<\\/h3>\\n<p class=\\\"t-center m-b-22 size3 m-l-r-auto\\\">Donec quis lorem nulla. Nunc eu odio mi. Morbi nec lobortis est. Sed fringilla, nunc sed imperdiet lacinia, nisl ante egestas mi, ac facilisis ligula sem id neque.<\\/p>\\n<\\/div>\\n<\\/div>\\n<div class=\\\"col-md-6 p-b-30\\\">\\n<div class=\\\"wrap-pic-delicious size2 bo-rad-10 hov-img-zoom m-l-r-auto\\\"><img src=\\\"https:\\/\\/preview.colorlib.com\\/theme\\/pato\\/images\\/our-story-01.jpg\\\" alt=\\\"IMG-OUR\\\" loading=\\\"lazy\\\"><\\/div>\\n<\\/div>\\n<\\/div>\\n<!-- Romantic -->\\n<div class=\\\"row p-t-170\\\">\\n<div class=\\\"col-md-6 p-b-30\\\">\\n<div class=\\\"wrap-pic-romantic size2 bo-rad-10 hov-img-zoom m-l-r-auto\\\"><img src=\\\"https:\\/\\/preview.colorlib.com\\/theme\\/pato\\/images\\/our-story-02.jpg\\\" alt=\\\"IMG-OUR\\\" loading=\\\"lazy\\\"><\\/div>\\n<\\/div>\\n<div class=\\\"col-md-6 p-t-45 p-b-30\\\">\\n<div cla