(101, 'App\\Models\\User', 1, 'updated', 'App\\Models\\Page', 1, '{\"contents\":\"<section class=\\\"section section-soft\\\">\\n<div class=\\\"container-md\\\"><!-- Header -->\\n<div class=\\\"section-header\\\">\\n<h2 class=\\\"section-title\\\">What We Offer<\\/h2>\\n<p class=\\\"section-desc\\\">We provide end-to-end solutions designed to help businesses build reliable, scalable, and user-focused digital products.<\\/p>\\n<\\/div>\\n<!-- Cards -->\\n<div class=\\\"grid grid-cards\\\">\\n<div class=\\\"card\\\">\\n<h3>\\ud83d\\ude80 High Performance Systems<\\/h3>\\n<p>Optimized applications built for speed, scalability, and long-term reliability under real-world workloads.<\\/p>\\n<\\/div>\\n<div class=\\\"card\\\">\\n<h3>\\ud83d\\udd12 Secure Architecture<\\/h3>\\n<p>Security-first development using proven best practices to protect data, users, and business operations.<\\/p>\\n<\\/div>\\n<div class=\\\"card\\\">\\n<h3>\\ud83c\\udfa8 Modern UI &amp; UX<\\/h3>\\n<p>Clean, intuitive interfaces designed to improve usability, engagement, and overall user satisfaction.<\\/p>\\n<\\/div>\\n<div class=\\\"card\\\">\\n<h3>\\u2699\\ufe0f Custom Development<\\/h3>\\n<p>Tailored solutions built around your business needs, workflows, and long-term goals.<\\/p>\\n<\\/div>\\n<div class=\\\"card\\\">\\n<h3>\\u2601\\ufe0f Cloud &amp; Deployment<\\/h3>\\n<p>Scalable cloud infrastructure, CI\\/CD pipelines, and deployment strategies that just work.<\\/p>\\n<\\/div>\\n<div class=\\\"card\\\">\\n<h3>\\ud83d\\udee0 Ongoing Support<\\/h3>\\n<p>Continuous maintenance, monitoring, and improvements to keep your system secure, fast, and healthy.<\\/p>\\n<\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/section>\\n<section class=\\\"section\\\">\\n<div class=\\\"container-md\\\">\\n<div class=\\\"section-header\\\">\\n<h2 class=\\\"section-title\\\">How We Work<\\/h2>\\n<p class=\\\"section-desc\\\">A clear, collaborative process that keeps projects aligned, efficient, and focused on real outcomes.<\\/p>\\n<\\/div>\\n<div class=\\\"grid grid-steps\\\">\\n<div class=\\\"step-card\\\"><span class=\\\"step-number\\\">01<\\/span>\\n<h3>Discovery &amp; Planning<\\/h3>\\n<p>We start by understanding your goals, challenges, and users to define a clear roadmap for success.<\\/p>\\n<\\/div>\\n<div class=\\\"step-card\\\"><span class=\\\"step-number\\\">02<\\/span>\\n<h3>Design &amp; Development<\\/h3>\\n<p>Our team designs intuitive interfaces and builds scalable systems using modern, proven technologies.<\\/p>\\n<\\/div>\\n<div class=\\\"step-card\\\"><span class=\\\"step-number\\\">03<\\/span>\\n<h3>Launch &amp; Improve<\\/h3>\\n<p>We deploy with confidence, monitor performance, and continuously improve based on real-world feedback.<\\/p>\\n<\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/section>\\n<section class=\\\"section section-soft\\\">\\n<div class=\\\"container-md\\\">\\n<div class=\\\"split\\\">\\n<div class=\\\"split-text\\\">\\n<h2 class=\\\"section-title\\\">Why Choose Us<\\/h2>\\n<p class=\\\"section-desc align-left\\\">We&rsquo;re not just building software &mdash; we&rsquo;re building long-term partnerships focused on quality, clarity, and sustainable growth.<\\/p>\\n<\\/div>\\n<div class=\\\"split-list\\\">\\n<div class=\\\"list-item\\\">\\n<h4>Experienced Team<\\/h4>\\n<p>Years of hands-on experience delivering real-world systems across different industries.<\\/p>\\n<\\/div>\\n<div class=\\\"list-item\\\">\\n<h4>Clear Communication<\\/h4>\\n<p>Transparent timelines, regular updates, and no technical surprises.<\\/p>\\n<\\/div>\\n<div class=\\\"list-item\\\">\\n<h4>Future-Ready Solutions<\\/h4>\\n<p>Built with scalability and maintainability in mind, so your product grows with your business.<\\/p>\\n<\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/div>\\n<\\/section>\"}', '{\"contents\":\"<!-- Welcome -->\\n<section class=\\\"section-welcome bg1-pattern p-t-120 p-b-105\\\">\\n<div class=\\\"container\\\">\\n<div class=\\\"row\\\">\\n<div class=\\\"col-md-6 p-t-45 p-b-30\\\">\\