(1, 'preset1', 'Haha', 'layout-presets/qJkstaur2kFTaoZDXmanTqO1C62j6urnfQDSbo56.png', '<!-- Our Story -->\r\n<section class=\"bg2-pattern p-t-116 p-b-110 t-center p-l-15 p-r-15\"><span class=\"tit2 t-center\"> Italian Restaurant </span>\r\n<h3 class=\"tit3 t-center m-b-35 m-t-5\">Our Story</h3>\r\n<p class=\"t-center size32 m-l-r-auto\">Fusce at risus eget mi auctor pulvinar. Suspendisse maximus venenatis pretium. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Aliquam purus purus, lacinia a scelerisque in, luctus vel felis. Donec odio diam, dignissim a efficitur at, efficitur et est. Pellentesque semper est ut pulvinar ullamcorper. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Nulla et leo accumsan, egestas velit ac, fringilla tortor. Sed varius justo sed luctus mattis.</p>\r\n</section>\r\n<!-- Video -->\r\n<section class=\"section-video parallax100\" style=\"background-image: url(\'https://preview.colorlib.com/theme/pato/images/header-menu-01.jpg\');\">\r\n<div class=\"content-video t-center p-t-225 p-b-250\"><span class=\"tit2 p-l-15 p-r-15\"> Discover </span>\r\n<h3 class=\"tit4 t-center p-l-15 p-r-15 p-t-3\">Our Video</h3>\r\n<div class=\"btn-play ab-center size16 hov-pointer m-l-r-auto m-t-43 m-b-33\" data-bs-toggle=\"modal\" data-bs-target=\"#modal-video-01\">\r\n<div class=\"flex-c-m sizefull bo-cir bgwhite color1 hov1 trans-0-4\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- Delicious & Romantic-->\r\n<section class=\"bg1-pattern p-t-120 p-b-105\">\r\n<div class=\"container\"><!-- Delicious -->\r\n<div class=\"row\">\r\n<div class=\"col-md-6 p-t-45 p-b-30\">\r\n<div class=\"wrap-text-delicious t-center\"><span class=\"tit2 t-center\"> Delicious </span>\r\n<h3 class=\"tit3 t-center m-b-35 m-t-5\">RECIPES</h3>\r\n<p class=\"t-center m-b-22 size3 m-l-r-auto\">Donec quis lorem nulla. Nunc eu odio mi. Morbi nec lobortis est. Sed fringilla, nunc sed imperdiet lacinia, nisl ante egestas mi, ac facilisis ligula sem id neque.</p>\r\n</div>\r\n</div>\r\n<div class=\"col-md-6 p-b-30\">\r\n<div class=\"wrap-pic-delicious size2 bo-rad-10 hov-img-zoom m-l-r-auto\"><img src=\"https://preview.colorlib.com/theme/pato/images/our-story-01.jpg\" alt=\"IMG-OUR\" loading=\"lazy\"></div>\r\n</div>\r\n</div>\r\n<!-- Romantic -->\r\n<div class=\"row p-t-170\">\r\n<div class=\"col-md-6 p-b-30\">\r\n<div class=\"wrap-pic-romantic size2 bo-rad-10 hov-img-zoom m-l-r-auto\"><img src=\"https://preview.colorlib.com/theme/pato/images/our-story-02.jpg\" alt=\"IMG-OUR\" loading=\"lazy\"></div>\r\n</div>\r\n<div class=\"col-md-6 p-t-45 p-b-30\">\r\n<div class=\"wrap-text-romantic t-center\"><span class=\"tit2 t-center\"> Romantic </span>\r\n<h3 class=\"tit3 t-center m-b-35 m-t-5\">Restaurant</h3>\r\n<p class=\"t-center m-b-22 size3 m-l-r-auto\">Fusce iaculis, quam quis volutpat cursus, tellus quam varius eros, in euismod lorem nisl in ante. Maecenas imperdiet vulputate dui sit amet vestibulum. Nulla quis suscipit nisl.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- Banner -->\r\n<div class=\"parallax0 parallax100\" style=\"background-image: url(\'https://preview.colorlib.com/theme/pato/images/bg-cover-video-02.jpg\');\">\r\n<div class=\"overlay0-parallax t-center size33\">&nbsp;</div>\r\n</div>\r\n<!-- Chef -->\r\n<section class=\"section-chef bgwhite p-t-115 p-b-95\">\r\n<div class=\"container t-center\"><span class=\"tit2 t-center\"> Meet Our </span>\r\n<h3 class=\"tit5 t-center m-b-50 m-t-5\">Chef</h3>\r\n<div class=\"row\">\r\n<div class=\"col-md-8 col-lg-4 m-l-r-auto p-b-30\"><!-- -Block5 -->\r\n<div class=\"blo5 pos-relative p-t-60\">\r\n<div class=\"pic-blo5 size14 bo4 wrap-cir-pic hov-img-zoom ab-c-t\"><a href=\"#\"><img src=\"https://preview.colorlib.com/theme/pato/images/avatar-02.jpg\" alt=\"IGM-AVATAR\" loading=\"lazy\"></a></div>\r\n<div class=\"text-blo5 size34 t-center bo-rad-10 bo7 p-t-90 p-l-35 p-r-35 p-b-30\"><a class=\"txt34 dis-block p-b-6\" href=\"#\"> Peter Hart </a> <span class=\"dis-block t-center txt35 p-b-25\"> Chef </span>\r\n<p class=\"t-center\">Donec porta eleifend mauris ut effici-tur. Quisque non velit vestibulum, lob-ortis mi eget, rhoncus nunc</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-8 col-lg-4 m-l-r-auto p-b-30\"><!-- -Block5 -->\r\n<div class=\"blo5 pos-relative p-t-60\">\r\n<div class=\"pic-blo5 size14 bo4 wrap-cir-pic hov-img-zoom ab-c-t\"><a href=\"#\"><img src=\"https://preview.colorlib.com/theme/pato/images/avatar-03.jpg\" alt=\"IGM-AVATAR\" loading=\"lazy\"></a></div>\r\n<div class=\"text-blo5 size34 t-center bo-rad-10 bo7 p-t-90 p-l-35 p-r-35 p-b-30\"><a class=\"txt34 dis-block p-b-6\" href=\"#\"> Joyce Bowman </a> <span class=\"dis-block t-center txt35 p-b-25\"> Chef </span>\r\n<p class=\"t-center\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Proin ultricies felis a sem tempus tempus.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-md-8 col-lg-4 m-l-r-auto p-b-30\"><!-- -Block5 -->\r\n<div class=\"blo5 pos-relative p-t-60\">\r\n<div class=\"pic-blo5 size14 bo4 wrap-cir-pic hov-img-zoom ab-c-t\"><a href=\"#\"><img src=\"https://preview.colorlib.com/theme/pato/images/avatar-05.jpg\" alt=\"IGM-AVATAR\" loading=\"lazy\"></a></div>\r\n<div class=\"text-blo5 size34 t-center bo-rad-10 bo7 p-t-90 p-l-35 p-r-35 p-b-30\"><a class=\"txt34 dis-block p-b-6\" href=\"#\"> Peter Hart </a> <span class=\"dis-block t-center txt35 p-b-25\"> Chef </span>\r\n<p class=\"t-center\">Phasellus aliquam libero a nisi varius, vitae placerat sem aliquet. Ut at velit nec ipsum iaculis posuere quis in sapien</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<!-- Sign up -->\r\n<div class=\"section-signup bg1-pattern p-t-85 p-b-85\"><form class=\"flex-c-m flex-w flex-col-c-m-lg p-l-5 p-r-5\"><span class=\"txt5 m-10\"> Specials Sign up </span>\r\n<div class=\"wrap-input-signup size17 bo2 bo-rad-10 bgwhite pos-relative txt10 m-10\"><input class=\"bo-rad-10 sizefull txt10 p-l-20\" name=\"email-address\" type=\"text\" placeholder=\"Email Adrress\"></div>\r\n<!-- Button3 --> <button class=\"btn3 flex-c-m size18 txt11 trans-0-4 m-10\" type=\"submit\"> Sign-up </button></form></div>', 1, '2026-01-20 22:43:19', '2026-01-27 00:32:28'),
(2, 'preset2', NULL, 'layout-presets/bwMN52N2GpsyL0PJV3eyOzOeRV0NLAGZYx5h7JlL.png', '<!-- SECTION 1: Intro -->\r\n<section class=\"section section-soft\">\r\n  <div class=\"container-md section-header\">\r\n    <h2 class=\"section-title\">Digital Solutions for Modern Businesses</h2>\r\n    <p class=\"section-desc\">\r\n      We help organizations design, build, and scale digital products that are reliable,\r\n      secure, and built for long-term growth.\r\n    </p>\r\n  </div>\r\n</section>\r\n\r\n<!-- SECTION 2: Image + Text -->\r\n<section class=\"section\">\r\n  <div class=\"container-md split\">\r\n    <div>\r\n      <img src=\"https://images.unsplash.com/photo-1521737604893-d14cc237f11d\" alt=\"Team work\" style=\"width:100%; border-radius:14px;\" />\r\n    </div>\r\n    <div class=\"split-text\">\r\n      <h2 class=\"section-title\">Collaborative by Design</h2>\r\n      <p class=\"section-desc align-left\">\r\n        We work closely with stakeholders to ensure every solution aligns with business\r\n        goals and user needs.\r\n      </p>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<!-- SECTION 3: Services Grid -->\r\n<section class=\"section section-soft\">\r\n  <div class=\"container-md grid grid-cards\">\r\n    <div class=\"card\">\r\n      <h3>System Architecture</h3>\r\n      <p>Scalable, maintainable foundations built to support growth.</p>\r\n    </div>\r\n    <div class=\"card\">\r\n      <h3>Application Development</h3>\r\n      <p>Custom-built solutions using modern technologies.</p>\r\n    </div>\r\n    <div class=\"card\">\r\n      <h3>UX Optimization</h3>\r\n      <p>User-centered design that improves engagement.</p>\r\n    </div>\r\n  </div>\r\n</section>\r\n\r\n<!-- SECTION 4: Process -->\r\n<section class=\"section\">\r\n  <div class=\"container-md grid grid-steps\">\r\n    <div class=\"step-card\">\r\n      <span class=\"step-number\">01</span>\r\n      <h3>Plan</h3>\r\n      <p>Define scope, timeline, and success metrics.</p>\r\n    <