(1, NULL, 1, 'home', 'Home', 'Home', '<!-- Welcome -->\n<section class=\"section-welcome bg1-pattern p-t-120 p-b-105\">\n<div class=\"container\">\n<div class=\"row\">\n<div class=\"col-md-6 p-t-45 p-b-30\">\n<div class=\"wrap-text-welcome t-center\"><span class=\"tit2 t-center\"> Italian Restaurant </span>\n<h3 class=\"tit3 t-center m-b-35 m-t-5\">Welcome</h3>\n<p class=\"t-center m-b-22 size3 m-l-r-auto\">Donec quis lorem nulla. Nunc eu odio mi. Morbi nec lobortis est. Sed fringilla, nunc sed imperdiet lacinia, nisl ante egestas mi, ac facilisis ligula sem id neque.</p>\n<a class=\"txt4\" href=\"about.html\"> Our Story </a></div>\n</div>\n<div class=\"col-md-6 p-b-30\">\n<div class=\"wrap-pic-welcome size2 bo-rad-10 hov-img-zoom m-l-r-auto\"><img src=\"https://preview.colorlib.com/theme/pato/images/our-story-01.jpg\" alt=\"IMG-OUR\" loading=\"lazy\"></div>\n</div>\n</div>\n</div>\n</section>\n<!-- Intro -->\n<section class=\"section-intro\">\n<div class=\"header-intro parallax100 t-center p-t-135 p-b-158\" style=\"background-image: url(\'https://preview.colorlib.com/theme/pato/images/bg-intro-01.jpg\');\"><span class=\"tit2 p-l-15 p-r-15\"> Discover </span>\n<h3 class=\"tit4 t-center p-l-15 p-r-15 p-t-3\">Pato Place</h3>\n</div>\n<div class=\"content-intro bg-white p-t-77 p-b-133\">\n<div class=\"container\">\n<div class=\"row\">\n<div class=\"col-md-4 p-t-30\"><!-- Block1 -->\n<div class=\"blo1\">\n<div class=\"wrap-pic-blo1 bo-rad-10 hov-img-zoom\"><a href=\"#\"><img src=\"https://preview.colorlib.com/theme/pato/images/intro-01.jpg\" alt=\"IMG-INTRO\" loading=\"lazy\"></a></div>\n<div class=\"wrap-text-blo1 p-t-35\"><a href=\"#\">\n<h4 class=\"txt5 color0-hov trans-0-4 m-b-13\">Romantic Restaurant</h4>\n</a>\n<p class=\"m-b-20\">Phasellus lorem enim, luctus ut velit eget, con-vallis egestas eros.</p>\n<a class=\"txt4\" href=\"#\"> Learn More </a></div>\n</div>\n</div>\n<div class=\"col-md-4 p-t-30\"><!-- Block1 -->\n<div class=\"blo1\">\n<div class=\"wrap-pic-bl